import React from "react"


function TodoItem(props) {
	return (
		<div className="todo-item">
			<input
				type="checkbox"
				checked={props.item.completed}
				onChange={(event) => props.changeHandler(props.key)}
			/>
			<p className="text">{props.item.text}</p>
		</div>
	)
}

export default TodoItem
